import "./home.css";
import { motion } from "framer-motion/dist/framer-motion";
const Home = () => {
  return (
    <motion.div
    
intial={{opacity:0}} 
animate={{opacity:1}}
exit={{opacity:0}}
>
      <p>test</p>
    </motion.div>
  );
};
export default Home;
